  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0132716 includes physical
  and profile data collected aboard the ROGER REVELLE during cruise RR1110 in the
  Philippine Sea and South China Sea (Nan Hai) from 2011-07-11 to 2011-07-22. These
  data include CONDUCTIVITY, SALINITY and WATER TEMPERATURE. The instruments used
  to collect these data include CTD. These data were collected by Robert Pinkel of
  University of California - San Diego; Scripps Institution of Oceanography as part
  of Internal Waves in Straits Experiment (IWISE). The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling Deck to
